import "./early.scss";
import { useState } from "react";
import { motion } from "framer-motion";

export default function Early() {


    return (
    <div className="early" id="early">
        <motion.div
            initial={{ scale: 0 }}
            animate={{ rotate: 180, scale: 1 }}
            transition={{
                type: "spring",
                stiffness: 260,
                damping: 20
  }}
/>
    </div>
  )
}
